import React from "react";

function Table_dar(props){
    let a;
    switch(props.bg){
        case "var(--primary)" : a = "border-primary"; break;
        case "var(--danger)"  : a = "border-danger"; break;
        case "var(--success)" : a = "border-success"; break;
        case "var(--primary)" : a = "border-primary"; break;
    }
    if(props.bg == "var(--primary)"){
        a = "border-primary"
    }else if(props.bg == "var(--danger)"){
        a = "border-danger"
    }else if(props.bg == "var(--success)"){
        a = "border-success"
    }else if(props.bg == "var(--warning)"){
        a = "border-warning"
    }

    return(
    <div className={`${props.classN} border ${a} d-flex justify-content-center align-items-center rounded`}
    style={{backgroundColor:props.bg}}> 
       <div className="Circle-player rounded-circle">
          <div className="rounded-circle border Boy Boy1" style={{backgroundColor:props.bg}}> </div>
          <div className="rounded-circle border Boy Boy2" style={{backgroundColor:props.bg}}> </div>
          <div className="rounded-circle border Boy Boy3" style={{backgroundColor:props.bg}}> </div>
          <div className="rounded-circle border Boy Boy4" style={{backgroundColor:props.bg}}> </div>
       </div>
    </div>
    )
}
export default Table_dar
